import {Component, OnInit} from '@angular/core';
import {UserHttpService} from "../user-http.service";

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent implements OnInit{
  private user = {  // object that will be passed to express to create the mongoose user model
    username: '',
    email: '',
    password: '',
    date: undefined
  }

  constructor(private us: UserHttpService) {
  }

  private createAndrea(){
    return {
      username: 'BassHoundFromTs',
      email: 'basso@gmail.com',
      password: '12345678',
      date: new Date()
    }
  }
  signup() {
    this.us.register(this.createAndrea())
  }

  ngOnInit(): void {
    this.signup();
    console.log('This is after Signup function');
  }
}
